            margin-bottom: 35px;
        }

        .profile-btn:hover {

            color: #000;
        }

        .profile-btn img {
            position: absolute;
            left: 10px;
            height: 30px;
            top: 50%;
            object-fit: contain;
            object-position: center;
            transform: translate(0%, -50%);
        }

        .support-me {
            display: block;
            background: #FFFFFF40;
            border: 1px solid #fff;
            border-radius: 50px;
            color: #fff;
            text-align: center;
            padding: 12px 10px;
            margin-bottom: 20px;
            cursor: pointer;
            box-shadow: inset 0px 3px 5px rgba(255, 255, 255, 0.5), 0px 0px 10px rgba(0, 0, 0, 0.15);
            position: relative;
            text-decoration: none;
            -webkit-animation: glowing 2000ms infinite;
            -moz-animation: glowing 2000ms infinite;
            -o-animation: glowing 2000ms infinite;
            animation: glowing 2000ms infinite;
        }

        .support-me:hover {
            background: #fff;
            color: #000;
            -webkit-animation: none;
            -moz-animation: none;
            -o-animation: none;
            animation: none;
        }

        @-webkit-keyframes glowing {
            0% {
                background-color: #FFFFFF40;
                -webkit-box-shadow: 0 0 3px #FFFFFF40;
            }

            50% {
                background-color: #FFFFFF40;
                -webkit-box-shadow: 0 0 40px #FFFFFF40;
            }

            100% {
                background-color: #FFFFFF40;
                -webkit-box-shadow: 0 0 3px #FFFFFF40;
            }
        }

        @-moz-keyframes glowing {
            0% {
                background-color: #FFFFFF40;

            }

            50% {
                background-color: #FFFFFF40;
                -moz-box-shadow: 0 0 40px #FFFFFF40;
            }

            100% {
                background-color: #FFFFFF40;
                -moz-box-shadow: 0 0 3px #FFFFFF40;
            }
        }

        @-o-keyframes glowing {

            }

            50% {
                background-color: #FFFFFF40;
